export function ido(arr) {
  for (let i = 0; i < arr.length; i++) {
    let changesArray = arr[i].changes;
    let changesStringsArray = [];

    for (let j = 0; j < changesArray.length; j++) {
      changesStringsArray.push(changesArray[j].changeName);
    }

    arr[i].changes = changesStringsArray;
  }

  console.log(arr);
}
